import React from 'react';

function HomePage() {
  return (
    <div>
      <h1>Welcome to AlienCrops</h1>
      <p>Your extraterrestrial farming solution!</p>
      <ul>
        <li>Advanced Weather Analysis</li>
        <li>Precision Soil Moisture Forecasting</li>
        <li>Alien Crop Management</li>
      </ul>
    </div>
  );
}

export default HomePage;
